チャイルドシート FUN+FIT　　対象年齢9ヶ月～11歳/3段階調整<br>ECEヨーロッパ統一安全基準適合<br>
2015年7月発売<br><br>

<br />
スタイリッシュなデザインに加え、心地よい座り心地、<br />
高い安全性を確保した９ケ月から使えるチャイルド＆ジュニアシート<br />
<br />
【ブランド名】FUN+FIT（ファンタスフィット）

 <br />
 【商品名】フィットロングデラックス<br />
 <br />
 ９ケ月（９ｋｇ）～１１歳（３６ｋｇ）まで成長に応じて３ステップで使用できます。<br />
 軽量タイプで座面はゆったり、座席にもしっかり固定できる、<br />
 快適性と安全性を兼ね備えたチャイルド＆ジュニアシートです。<br />
 ２０１２年７月、日本でも完全移行した<br />
 安全基準の最高峰「ＥＣＥヨーロッパ統一安全規則」に適合。<br />
 高い安全性を確保しながら、リーズナブルな価格となっています。<style type="text/css">
