スーパーGTで常勝する一流のレーシングドライバーが選ぶ、ブリッドのピュアレーシングシート、ガルディス3。より軽く、より剛性を上げるために設定されたシェルは厳しいFIAホモロゲーションもクリアーしています。大きく張り出したヘッドガードは高速のコーナリング時にはドライバーの頭部をしっかりとホールドし、クラッシュ時にはドライバーの頭部をしっかり保護します。<br><br>●使用シートレール：FO・FB・FKもしくはFGタイプ（各車両によりFO・FB・FK及びFGタイプいずれかの設定になります）、FXタイプ（FXタイプでもシートポジションは同等となります） ●材質：カーボンアラミド ●FIA公認 ●日本製 ●重量：約7.7kg ●競技用モデル ●納期：この商品は受注生産品のためご注文後、通常7～10日後出荷予定です。（※通常納期を著しく超える場合は別途ご連絡させて頂きます）<br><br>※競技用モデルのため、一般公道での使用は絶対しないでください。<br><br>汎用品<br><br><br><br>インテリア | シート<tr><td colspan="2">
